import React from "react";
import Encens from "../imgs/encens.jpg";
import { Button, Card } from "react-bootstrap";

const Hero = () => {
  return (
    <>
      <Card>
        <Card.Img variant="top" src={Encens} />
        <Card.Body>
          <Card.Text>
            Some quick example text to build on the card title and make up the
            bulk of the card's content.
          </Card.Text>
        </Card.Body>
      </Card>
      <br />
      <Card>
        <Card.Body>
          <Card.Text>
            Some quick example text to build on the card title and make up the
            bulk of the card's content.
          </Card.Text>
        </Card.Body>
        <Card.Img variant="bottom" src={Encens} />
      </Card>
    </>
  );
};

export default Hero;
